import React, { useState, useEffect } from "react";
import { Container, Navbar, Nav, Image } from "react-bootstrap";

function Navigation() {
  const [isHidden, setIsHidden] = useState(true);

  const toggleList = () => {
    setIsHidden(!isHidden);
  };

  useEffect(() => {
    const handleResize = () => {
      if (window.innerWidth < 972) {
        setIsHidden(true);
      } else {
        setIsHidden(false);
      }
    };

    window.addEventListener("resize", handleResize);

    return () => {
      window.removeEventListener("resize", handleResize);
    };
  }, []);

  return (
    <Navbar bg="light" expand="lg" sticky="top">
      <Container>
        <Navbar.Brand href="#home">
          <Image src={logo} alt="Logo" fluid />
        </Navbar.Brand>
        <Navbar.Toggle aria-controls="navbar-nav" />
        <Navbar.Collapse id="navbar-nav">
          <Nav className="me-auto">
            <Nav.Link href="#home">Home</Nav.Link>
            <Nav.Link href="#about">About</Nav.Link>
            <Nav.Link href="#financial-planning">Financial Planning</Nav.Link>
            <Nav.Link href="#investment-planning">Investment Planning</Nav.Link>
            <Nav.Link href="#insurance">Insurance</Nav.Link>
            <Nav.Link href="#blog">Blog</Nav.Link>
            <Nav.Link href="#contact-us">Contact Us</Nav.Link>
          </Nav>
        </Navbar.Collapse>
        <button className="navbar-toggler" type="button" onClick={toggleList}>
          <span className="navbar-toggler-icon"></span>
        </button>
        <ul
          className="d-lg-none"
          style={{
            display: isHidden || window.innerWidth < 992 ? "none" : "block",
            position: "absolute",
            top: "100%",
            left: "0",
            zIndex: "1000",
            backgroundColor: "#fff",
            border: "1px solid #dee2e6",
            borderRadius: "0.25rem",
            padding: "0.5rem 0",
            minWidth: "10rem",
            transition: "transform 0.3s ease-out",
            transform: isHidden ? "translateY(-10px)" : "translateY(0)",
          }}
        >
          <li className="py-2 px-3">
            <a href="#home">Home</a>
          </li>
          <li className="py-2 px-3">
            <a href="#about">About</a>
          </li>
          <li className="py-2 px-3">
            <a href="#financial-planning">Financial Planning</a>
          </li>
          <li className="py-2 px-3">
            <a href="#investment-planning">Investment Planning</a>
          </li>
          <li className="py-2 px-3">
            <a href="#insurance">Insurance</a>
          </li>
          <li className="py-2 px-3">
            <a href="#blog">Blog</a>
          </li>
          <li className="py-2 px-3">
            <a href="#contact-us">Contact Us</a>
          </li>
        </ul>
      </Container>
    </Navbar>
  );
}

export default Navigation;
